  `nombres_usu` varchar(75) DEFAULT NULL,
  `usuario_usu` varchar(20) DEFAULT NULL,
  `contrasenia_usu` varchar(20) DEFAULT NULL,
  `tipo_usu` varchar(15) DEFAULT NULL,
  `correo_usu` varchar(25) DEFAULT NULL,
  `activo_usu` varchar(1) DEFAULT NULL,
  `jornada` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id_usu`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

